import React from 'react'
var tf = require('@tensorflow/tfjs')

let model = null
let uri = 'http://localhost:3000/modelJS/model.json'
console.log(uri);
model = tf.loadLayersModel('uri')

const Main = () => {

	if (model == null)
		console.log('model loaded')
	return null
}

export default Main;
